package personal.beans;

public class TempReport {
	
	private String eid;
	
	private String ename;
	
	private Double escore;
	
	private Double rscore;
	
	private String epaper;
	
	

	public TempReport() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getEid() {
		return eid;
	}

	public void setEid(String eid) {
		this.eid = eid;
	}

	public String getEname() {
		return ename;
	}

	public void setEname(String ename) {
		this.ename = ename;
	}

	public Double getEscore() {
		return escore;
	}

	public void setEscore(Double escore) {
		this.escore = escore;
	}

	public Double getRscore() {
		return rscore;
	}

	public void setRscore(Double rscore) {
		this.rscore = rscore;
	}

	public String getEpaper() {
		return epaper;
	}

	public void setEpaper(String epaper) {
		this.epaper = epaper;
	}
	
	
}
